INSERT INTO `templates` VALUES (1,'Example Cooking Camp',NULL,'This is an example program session. Scroll down to see the age range, collaborating organizations, and schedule. If you\'d like to propose a program to another organization, you\'ll need to add a template first. Click \"Templates\" above, and then create your first program template!',7,70,'ages',10000,'per participant',180,1,5,1,'2019-08-06 02:04:16','2019-08-06 02:04:16',NULL,NULL,NULL,NULL),(2,'Minecraft Challenge','MC','Spawn into the curious world of Minecraft! Learn the fundamentals of video game design as you create epic worlds with the help of your fellow campers and command-line coding in WorldEdit, make awesome screencasts like your favorite YouTubers, and during free time, compete in Minecraft Hunger Games, Sky Wars, and more! This is the Minecraft summer camp youve been waiting for.',7,12,'ages',35000,'per participant',420,1,5,2,'2019-08-07 16:56:08','2020-01-10 22:54:58','Please pack a healthy lunch, snacks, sunscreen, and clothes you can play in!','We need grounded power outlets. We prefer rooms with tables rather than desks, and we like to arrange them ourselves so we can avoid tripping hazards.',10,12),(9,'Stop-Motion Minecraft Animation!','SMA','Get ready to use cameras and Minecraft characters to create amazing stop-motion animation movies! Whether your story is about fighting the wither, going on an adventure, or building the coolest pixel art in the overworld, youll have an opportunity to tell it at Stop-Motion Minecraft Animation! Well create real-life sets as we learn about stop-motion animation (think Wallace and Gromit!), then film, edit, and upload our creations to YouTube!',7,12,'ages',15000,'per participant',180,1,5,2,'2019-09-16 19:25:15','2019-09-16 19:29:03','Please pack healthy snacks, sunscreen, and clothes you can play in!','We need grounded power outlets. We prefer rooms with tables rather than desks, and we like to arrange them ourselves so we can avoid tripping hazards.',10,12),(10,'Minecraft YouTubers: Lets Play!','MYT','Learn what it takes to make epic Minecraft videos for YouTube like TheDiamondMinecart, CaptainSparklez, Stampy, and more! Whether you want to make a Lets Play video, a funny skit, a build battle, or something even cooler, youll have the tools and expert help needed to make your dreams a reality! And all the while well learn about internet safety so that when class is over, we can upload your video to YouTube!',7,12,'ages',17500,'per participant',180,1,5,2,'2019-09-16 19:27:46','2020-01-29 19:34:45','Please pack healthy snacks, sunscreen, and clothes you can play in!','We need grounded power outlets. We prefer rooms with tables rather than desks, and we like to arrange them ourselves so we can avoid tripping hazards.',10,12),(11,'Live-Action YouTube Stars!','YTS','Learn what it takes to make epic Minecraft videos for YouTube like TheDiamondMinecart, CaptainSparklez, Stampy, and more! Whether you want to make a Lets Play video, a funny skit, a build battle, or something even cooler, youll have the tools and expert help needed to make your dreams a reality! And all the while well learn about internet safety so that when class is over, we can upload your video to YouTube!',7,12,'ages',17500,'per participant',180,1,5,2,'2019-09-16 19:28:46','2019-09-16 19:28:46','Please pack healthy snacks, sunscreen, and clothes you can play in!','We need grounded power outlets. We prefer rooms with tables rather than desks, and we like to arrange them ourselves so we can avoid tripping hazards.',10,12),(12,'Video Game Design & Command-Line Coding with Minecraft!','VGD','Imagine being able to construct a glass dome for your Minecraft Hunger Games Map or Mob Arena with a single line of code. We\'ll learn to use WorldEdit\'s powerful command-line code to make designing epic maps faster and even more fun. If you\'re interested in coding but don\'t know where to start, this is the camp for you!',7,12,'ages',17500,'per participant',180,1,5,2,'2019-09-16 19:30:04','2020-01-29 19:34:40','Please pack a healthy lunch, snacks, sunscreen, and clothes you can play in!','We need grounded power outlets. We prefer rooms with tables rather than desks, and we like to arrange them ourselves so we can avoid tripping hazards.',10,12),(13,'TinkerTech Invention Code','Grade 3-5','Hands-on tinkeirng and inventing as you learn to code games in this fun class!',7,11,'ages',10000,'per participant',180,1,5,28,'2019-10-01 16:54:06','2019-10-01 16:54:06',NULL,NULL,5,12);
